DECLARE @SSN1 TABLE  (BF_SSN VARCHAR(9));

DECLARE @SSN2 TABLE  (BF_SSN VARCHAR(9));

DECLARE @SSN3 TABLE  (BF_SSN VARCHAR(9));

DECLARE @SSN4 TABLE (BF_SSN VARCHAR(9));

DECLARE @SSN5 TABLE (BF_SSN VARCHAR(9));

DECLARE @SSN6 TABLE (BF_SSN VARCHAR(9));





SELECT
	DF_SPE_ACC_ID,
	ALLSSNS.BF_SSN
FROM
	(
		SELECT * FROM @SSN1 UNION ALL
		SELECT * FROM @SSN2 UNION ALL
		SELECT * FROM @SSN3 UNION ALL
		SELECT * FROM @SSN4 UNION ALL
		SELECT * FROM @SSN5 UNION ALL
		SELECT * FROM @SSN6
	) ALLSSNS
	INNER JOIN UDW..PD10_PRS_NME PD10
		ON ALLSSNS.BF_SSN = PD10.DF_PRS_ID
ORDER BY
	BF_SSN
